import React from 'react';
import ReactDOM from 'react-dom';
const superagent = require('superagent');

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      characters: {},
      stats: {}
    };
  }
  componentDidMount() {
    superagent.get('http://localhost:4000/api/v1/Characters').then(results => {
      this.setState({ characters: results.body.playable[0] });

      Object.values(this.state.characters).forEach(item => {
        Object.values(item).forEach(property => {
          // console.log(property);
        });
      });
    });
  }
  render() {
    return (
      <div>
        {Object.values(this.state.characters).map((item, index) => {
          Object.values(item).map((property, ind) => {
            console.log(property);
            return <span key={ind}>{property}</span>;
          });
          return <br key={index} />;
        })}
      </div>
    );
  }
}

const rootElement = document.getElementById('root');
ReactDOM.render(<App />, rootElement);
